details.Ref_orig:
         When you pass the logical ID of this resource to the intrinsic Ref function, Ref returns a string containing pipe-separated DomainId and
the EnvironmentBlueprintId, which uniquely identifies the environment
blueprint configuration. For example: { "Ref": "MyBlueprintConfiguration" }
for the resource with the logical ID MyBlueprintConfiguration,
   Ref returns DomainId|BlueprintConfigurationId.

When you pass the logical ID of this resource to the intrinsic Ref
            function, Ref returns the resource name. For example, { "Ref": "myRuleset"
                }.
